import React from 'react';
import ProductForm from '../components/ProductForm';

const CreateProductPage = () => {
    return (
        <div className="create-product-page">
            <h1>Create New Product</h1>
            <ProductForm />
        </div>
    );
};

export default CreateProductPage;
